import React from 'react';
import './App.css';
import Home from './pages/Home'
import { Link ,Route } from 'wouter'

function App() {
  return (
    <div className="App">
      <section className="App-content">
        <h1>App</h1>
      <Link to="/">

      </Link>

        <Route
          component={Home}
          path="/"
        />

        
      </section>
    </div>
  );
}

export default App;
